@Murphy_J26 필로폰 1회분은 통상 0.03g으로 계산하나 이것도 옛날 얘기. 옛날에 비해 지금 유통되는 뽕들은 순도가 낮아서 사실상 0.1g은 때려넣는 추세. 
어쨌든 그렇게 계산해도 300회 분량. 혼자 쌓아두고 했다고 하기에도 적지 않은 양. 
이 정도라면 투약한 고사바리들 잡기보단 판매책 수사에 힘써야할듯..

